import React from "react";
import { BrowserRouter, Route, Routes, } from 'react-router-dom';

import Login from "./components/LogIn";

function App() {
    return (
        <div className="SignUp" id="SignUp">
          <BrowserRouter>
            <Routes>
              <Route path="/"/>
              <Route path="/login/" element={<Login />}/>
            </Routes>
          </BrowserRouter>
        </div>
      );
}

export default App;
